import React, { Component } from 'react'
import banner3 from '../image/office.jpg';
import '../assets/css/Home.css';
 class Home extends Component {
    render() {
        return (
            <div>
            <section id="About" className="about">
                <div className="container">
                <div className="datahometitle mt-2">PROCUREMENT EXPERT</div>
                    <div className="row">
                        <div className="col-md-6 datahomearticle">
                            <div className="datahomebtn">
                                <p>&nbsp;&nbsp;&nbsp;&nbsp; We at MATPLAZA Philippines Inc., welcomes you to our wide range of construction products. We offer almost of your interior design needs and some exterior design finishes like Natural stones, Terracotta, Tiles, UPVC doors and windows, Home automation system, Sun shading system, Glass and enclosures.With our expertise in the industry and procurement connection, we assure to give you our best quotation at a very reasonable price without compromising the value of our service and product. Dont hesitate to contact us. Let us hear your inquiries. Warm welcome!</p>
                            </div>
                        </div>
                        <div className="col-md-6">
                        <img className="datahomeimg responsive" alt="" src={banner3}/>
                        </div>
                    </div>
                </div>
            </section>
            </div>     
        )
    }
}

export default Home;
